import React from 'react';

import { Container, Nav, Logo, Link } from './styles';
import imgLogo from 'src/assets/logo.png';

const Header: React.FC = () => {
  return (
    <Container>
      <Nav>
        <Logo src={imgLogo} alt="Logo do Site" />
        <Link>a</Link>
        <Link>b</Link>
        <Link>c</Link>
      </Nav>
    </Container>
  );
};

export default Header;
